import React from 'react';
import TinderCard from 'react-tinder-card';
import Slider from 'react-slick';
import './index.css';
import house1 from './images/3589453_0.jpg';

function NextArrow(props) {
  const { onClick } = props;
  return (
    <div className="arrow next" onClick={onClick}>
      ➔
    </div>
  );
}

function PrevArrow(props) {
  const { onClick } = props;
  return (
    <div className="arrow prev" onClick={onClick}>
      ←
    </div>
  );
}

function CardSwiping({ house, onSwipe }) {
  const sliderSettings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    nextArrow: <NextArrow />,
    prevArrow: <PrevArrow />,
  };

  return (
    <div>
      <TinderCard
        className="swipe"
        onSwipe={(direction) => onSwipe(direction)}
        preventSwipe={['up', 'down']}
      >
        <div className="card">
          <Slider {...sliderSettings}>
            {(house.images && house.images.length > 0 ? house.images : [house1]).map((imgUrl, index) => (
              <div key={index} className="carouselImage">
                <img src={imgUrl} alt={`${house.name} - ${index + 1}`} />
              </div>
            ))}

          </Slider>
          <h3 style={{ color: 'black' }}>{house.brokerTitle}</h3>
          <p style={{ color: 'black' }}>{house.type}</p>
          <p>{house.price}</p>
          <p>{house.beds} Beds</p>
          <p>{house.bath} Baths</p>
          <p>{house.propertySqFt} SqFt</p>
          <p>{house.formattedAddress}</p>
        </div>
      </TinderCard>
    </div>

  );
}

export default CardSwiping;
